  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes requests for information
  filed with the San Francisco Rent Board under SF Admin. Code 37.9(i) or (j). Under
  the Code, residents receiving an eviction notice may claim protected status either
  due to age and/or disability and length of tenancy or based on length of tenancy
  and occupancy of a child under the age of 18 during the school year. They need not
  be filed as estoppels. However, it has become common practice to add the request
  pursuant to (I) or (j) to estoppels, which is a legal term for limiting a legal
  action that could normally be taken, e.g. evicting. Data are available starting
  in January 1999.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
